[{"location":"Utils/Print/#Print","page":"Print","title":"Print","text":"","category":"section"},{"location":"Utils/Print/#Examples","page":"Print","title":"Examples","text":"using Junimo # hide\n\nred(\"Red text\")\ngreen(\"Green text\")\nblue(\"Blue text\")\npurple(\"Purple text\")","category":"section"},{"location":"Utils/Print/#APIs","page":"Print","title":"APIs","text":"","category":"section"},{"location":"Utils/Print/#Junimo.cprint","page":"Print","title":"Junimo.cprint","text":"cprint(text, code)\n\nPrint text to standard output using the specified ANSI color code.\n\nThis is a low-level utility function for customized terminal output.\n\nArguments\n\ntext: The string to print.\ncode: The integer ANSI color code (e.g., 31 for red, 32 for green).\n\nExamples\n\ncprint(\"System initialized\", 33) # Prints yellow text\n\n\n\n\n\n","category":"function"},{"location":"Utils/Print/#Junimo.red","page":"Print","title":"Junimo.red","text":"red(text)\n\nPrint a line of text in Red (ANSI 31).\n\nTypically used for errors, warnings, or to indicate \"Bad Luck\" (the Red Skull from the Fortune Teller).\n\nExamples\n\nred(\"Error: Data mismatch detected!\")\n\n\n\n\n\n","category":"function"},{"location":"Utils/Print/#Junimo.green","page":"Print","title":"Junimo.green","text":"green(text)\n\nPrint a line of text in Green (ANSI 32).\n\nThis is the color of the Junimos. Use this to indicate success, completed tasks, or stable model conditions.\n\nExamples\n\ngreen(\"Processing complete. Junimos are happy.\")\n\n\n\n\n\n","category":"function"},{"location":"Utils/Print/#Junimo.blue","page":"Print","title":"Junimo.blue","text":"blue(text)\n\nPrint a line of text in Blue (ANSI 34).\n\nUse this for general information, hydrological data outputs, or water-related metrics. \n\n\n\n\n\n","category":"function"},{"location":"Utils/Print/#Junimo.purple","page":"Print","title":"Junimo.purple","text":"purple(text)\n\nPrint a line of text in Purple (ANSI 35).\n\nThis is the color of Iridium and Stardrops. Use this for high-priority messages, significant results, or \"Great Luck\" days.\n\nExamples\n\npurple(\"Optimization finished! Results are Iridium quality.\")\n\n\n\n\n\n","category":"function"},{"location":"#Junimo.jl","page":"Junimo.jl","title":"Junimo.jl","text":"","category":"section"},{"location":"#Functions","page":"Junimo.jl","title":"Functions","text":"","category":"section"}]
